    (h2 : ∃! x, p x) (h1 : ∀ x, p x → (∀ y z, p y → p z → y = z) → b) : b    := by
  exact ExistsUnique.elim h2 (fun x h3 h4 => h1 x h3 (fun y z h5 h6 => by rw [h4 y h5, h4 z h6]))

